import React, {Component} from "react";
import Menu from './MenuComponent';
import Dishdetail from "./DishdetailComponent";
import {DISHES} from "../shared/dishes";
import { Button, View, Platform } from 'react-native';
import { NavigationContainer, DrawerActions } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createDrawerNavigator } from '@react-navigation/drawer';
import Constants from "expo-constants";
import Home from "./HomeComponent";
import RenderContact from "./ContactComponent";
import AboutUs from "./AboutUsComponent";


const MenuNavigator = createStackNavigator();

const HeaderOptions = {
    headerStyle: {
        backgroundColor: "#512DA8"
    },
    headerTintColor: "#fff",
    headerTitleStyle: {
        color: "#fff"
    }
};

function MenuNavigatorScreen() {
    return(
        <MenuNavigator.Navigator
            initialRouteName='Menu'
            screenOptions={HeaderOptions}
        >
            <MenuNavigator.Screen
                name="Menu"
                component={Menu}
            />
            <MenuNavigator.Screen
                name="Dishdetail"
                component={Dishdetail}
                options={{ headerTitle: "Dish Detail"}}
            />
        </MenuNavigator.Navigator>
    );
}

const ContactNavigator = createStackNavigator();
function ContactNavigatorScreen() {
return( <ContactNavigator.Navigator
initialRouteName = "Menu"
screenOption = {HeaderOptions}
>
    <ContactNavigator.Screen
    name ="Contact"
    component = {RenderContact}
    option = {{headerTitle: "Contact"}}
    />
</ContactNavigator.Navigator>)


}
const AboutUsNavigator = createStackNavigator();
function AboutUsNavigatorScreen() {
    return( <AboutUsNavigator.Navigator
        initialRouteName = "Menu"
        screenOption = {HeaderOptions}
    >
        <AboutUsNavigator.Screen
            name ="About Us"
            component = {AboutUs}
        />
    </AboutUsNavigator.Navigator>)


}

const HomeNavigator = createStackNavigator();


function HomeNavigatorScreen() {
    return(
        <HomeNavigator.Navigator
            initialRouteName='Menu'
            screenOptions={HeaderOptions}
        >
            <HomeNavigator.Screen
                name="Home"
                component={Home}
            />

        </HomeNavigator.Navigator>
    );
}


const MainNavigator = createDrawerNavigator();

function MainNavigatorDrawer() {
    return(
        <MainNavigator.Navigator
            initialRouteName="Home"
            drawerStyle={{
                backgroundColor:'#D1C4E9'
            }}
        >

            <MainNavigator.Screen name="Home" component={HomeNavigatorScreen} />
            <MainNavigator.Screen name="Menu" component={MenuNavigatorScreen} />
            <MainNavigator.Screen  option = {{headerTitle: "Contact"}} name="Contact" component={ContactNavigatorScreen} />
            <MainNavigator.Screen name = "About us" component={AboutUsNavigatorScreen}/>
        </MainNavigator.Navigator>
    );
}

class Main extends Component {

    render() {

        return(
            <NavigationContainer>
                <MainNavigatorDrawer/>
            </NavigationContainer>
        );
    }
}

export default Main;
